import React,{Fragment,useEffect,useState} from 'react';
import {useParams , useHistory} from 'react-router-dom';
import Axios from 'axios';


let UpdateUser = () => {
    let {id} = useParams();
    
    return (
        <Fragment>
            
            <h1>{JSON.stringify(id)}</h1>
           
        </Fragment>
    )
}

export default UpdateUser;
